import React from 'react';
import asyncComponent from '../../../util/asyncComponent';
import { Redirect, Route, Switch } from 'react-router-dom';
import Can from '../../../can';
import { RoleContext } from "../../../Context";
import ALMANACH from "./routes/Emploi"
import Planning from "./routes/Planning/Planning"



const Calendar = ({ match, estabModule }) => (

    <div className="app-wrapper">
        <Switch>
            <Redirect exact from={`${match.url}/`} to={`${match.url}/emploi`} />
            <Route path={`${match.url}/emploi`} render={() =>
                <RoleContext.Consumer>
                    {({ role }) => (
                        < Can
                            role={role}
                            perform="module-nav-access"
                            data={{
                                mod: 'calendar',
                                moduleList: estabModule
                            }}
                            yes={() => (
                                < Can
                                    role={role}
                                    perform={`module-nav-emploi`}
                                    yes={() => (
                                        < ALMANACH match={match} />
                                    )}
                                    no={() => <Route component={asyncComponent(() => import('../../../components/Error404'))} />}

                                />
                            )}
                            no={() => <Route component={asyncComponent(() => import('../../../components/Error404'))} />}
                        />
                    )}
                </RoleContext.Consumer>
            } />
            <Route path={`${match.url}/planning`} render={() =>
                <RoleContext.Consumer>
                    {({ role }) => (
                        < Can
                            role={role}
                            perform="module-nav-access"
                            data={{
                                mod: 'calendar',
                                moduleList: estabModule
                            }}
                            yes={() => (
                                < Can
                                    role={role}
                                    perform={`module-nav-planning`}
                                    yes={() => (
                                        < Planning match={match} />
                                    )}
                                    no={() => <Route component={asyncComponent(() => import('../../../components/Error404'))} />}

                                />
                            )}
                            no={() => <Route component={asyncComponent(() => import('../../../components/Error404'))} />}
                        />
                    )}
                </RoleContext.Consumer>
            } />
        </Switch>
    </div>
)





export default Calendar;
